<script setup>
  import { onMounted, ref } from 'vue';
  import { topThreeCatches } from '../../services/Api'; 
  import { useAuthStore } from 'stores/authStore';

  // Get the store instance
  const authStore = useAuthStore();
  const bearerToken = ref(null);
  const topThree = ref([]);


  async function topTreeHandler(bearerToken) {
    try {
      const response = await topThreeCatches(bearerToken);
      topThree.value = response;
    } catch (error) {
      console.log(error);
    }
  }

  onMounted(() => {
    authStore.isUserLogin();
    bearerToken.value = authStore.userToken;
    topTreeHandler(bearerToken.value)
  });
</script>

<template>
  <section class="top-catch-section">
    <h2>Tvojih Top Tri Ulova</h2>
    <ul class="top-catch-holder">
      <li class="top-catch-card" v-for="fish in topThree" :key="fish._id">
        <span class="card-img"> 
          <svg width="251" height="127" viewBox="0 0 251 127" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
          <rect width="251" height="127" fill="url(#pattern0)"/>
          <defs>
          <pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
          <use xlink:href="#image0_56_1279" transform="matrix(0.0011445 0 0 0.00226196 -0.0358566 -0.150227)"/>
          </pattern>
          <image id="image0_56_1279" width="919" height="561" xlink:href="data:image/png;base64,"/>
          </defs>
        </svg>
        </span>
        <div class="card-content">
          <p class="fish-name">Ime Ribe: <span>{{ fish.fishType }}</span></p>
          <p class="fish-date">Datum: <span>{{ fish.createdAt.split('T')[0] }}</span></p>
          <p class="fish-weight">Tezina: <span>{{ fish.fishWeight }}</span></p>
          <p class="fish-baitType">Mamac: <span>{{ fish.baitType }}</span></p>
        </div>
      </li>
    </ul>
  </section>
</template>

